import React from 'react';

const Card = (props) => {
    const { name, email } = props;
    return (
        <div className='bg-light-pink dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='pink cotton candy' src={'https://robohash.org/${props.id}?150x150'} />
            <div>
                <h2>{props.name}</h2>
                <p>{props.description}</p>
            </div>
        </div>
    );
}

export default Card;
